import './App.css';
import { useEffect, useState } from 'react';

function App() {
    const [data, setData] = useState();
    <button onClick={()=>fetch('https://localhost:8000/hi').then((r) => console.log(r), [])}>Fetch</button>
    useEffect(() => {
        fetch('https://localhost:8000/hi').then((r) => console.log(r), []);
    });
    return <div className="App">Hello there</div>;
}

export default App;
